import { Component } from "@angular/core";
import { Personaje } from "../interfaces/Personaje";
import { DbzService } from "../services/dbz.service";

@Component({
  selector: 'app-dbz-main-page',
  templateUrl: './main-page.component.html'
})
export class DbzMainPageComponent{

  constructor(public dbzService: DbzService){

  }
}
<h1>DBZ MAIN PAGE</h1>
<hr>
<div class="row">
  <div class="col-6">
    <app-dbz-list [personajes]="personajes"
                  (onDeletePersonaje)="onDeletePersonaje($event)" ></app-dbz-list>
  </div>
  <div class="col-6">
    <app-dbz-add-character (onNuevoPersonaje)="onNuevoPersonaje($event)"></app-dbz-add-character>
  </div>
</div>
